import Nbar from '../NavxFooter/NavBar';
import PresentationWeb from './Pres';
import SecSectionP from './SecSectionP';
import Foo from '../NavxFooter/Footer';
import TsectionP from './TsectionP';
import { Parallax , ParallaxLayer } from '@react-spring/parallax';

const PageF1 = () => {
    return (
      <div className='bg-white dark:bg-black'>
        <Parallax pages={3}>
          <ParallaxLayer speed={0} offset={0} factor={0.5}>
            <Nbar/>
          </ParallaxLayer>
          <ParallaxLayer speed={0.5} offset={0.1 } factor={0.5}>
            <PresentationWeb/>
          </ParallaxLayer>
          <ParallaxLayer speed={0.8} offset={0.8} factor={0.5}>
            <SecSectionP />
          </ParallaxLayer>
          <ParallaxLayer speed={1.2} offset={1.3} factor={0.5}>
            <TsectionP /> 
          </ParallaxLayer>   
          <ParallaxLayer speed={1.2} offset={1.8} factor={0.5}>
            <Foo /> 
            </ParallaxLayer>
        </Parallax>
        
      </div>
    );
  };
  
  export default PageF1;
